	function Check-Idle()
	{
		
		if (Get-Process | Where-Object { ($_.Name -match "chrome") -or ($_.Name -match "thick") })
		{
			
			
			$global:killPrompt = $false
			$idle = ([PInvoke.Win32.UserInput]::IdleTime).Seconds
			
			if ($idle -gt 20)
			{
				$timer1.Enabled = $false
				$timer2.Enabled = $true
				Show-ChildForm_psf
				
			}
			
		}
		
	}
	$timer2_Tick={
		#TODO: Place custom script here
			
			$kill = $false
			
		
			do
		{
				$idle = ([PInvoke.Win32.UserInput]::IdleTime).Seconds
				Write-Host "tick2"
				
				if ($idle -ge 40)
				{
					
					Write-Host "tick3"
					$kill = $true
					$global:killPrompt = $true
				
				Get-Process | Where-Object { $_.Name -match "Chrome" } | Stop-Process -Force
				
				$timer1.Enabled = $true
				$timer2.Enabled = $false
				}
				
				if ($idle -le 1)
			{
				$global:killPrompt = $true
				$kill = $true
				$timer1.Enabled = $true
				$timer2.Enabled = $false
				}
			
			Start-Sleep -Milliseconds 250
			
			}
			while ($kill -eq $false)
			
			
		}
		
		
	
